import React from 'react';

type ConferenceRoomProps = {
  username: string,
}

const ConferenceRoom: React.FC<ConferenceRoomProps> = ({ username }: ConferenceRoomProps) => (
  <div className="mt-12 mb-12 flex flex-col items-center">
    <div>
      {username}'s room.
    </div>
    <div>
      Peeps talkin and stuff
    </div>
  </div>
);

export default ConferenceRoom;
